import React from 'react';
import Youtube from '../../assets/pics/youtube.svg';
import Instagram from '../../assets/pics/instagram.svg';
import Twitter from '../../assets/pics/twitter.svg';
import Twitch from '../../assets/pics/twitch.png';
import Discord from '../../assets/pics/discord.png';

const Header = () => {

	const logo = (

		<div className='header'>
			<img src={Tarayah} alt='Tarayah' className='tarayahHeader'/>
			<img src={World} alt='World' className='worldHeader'/>
		</div>
	)

	const socialsIcon = (

		<div>
		<a href='https://www.youtube.com/channel/UCsTBtbUxAVwsLF8devi7aUA' target='_blank' className='socialsIcon'>
		<img src={Youtube} alt='youtube' className='socialsIcon'/>
		</a>

		<a href='https://www.instagram.com'  target='_blank' className='socialsIcon'>
		<img src={Instagram} alt='instagram' className='socialsIcon'/>
		</a>

		<a href='https://www.twitter.com'  target='_blank' className='socialsIcon'>
		<img src={Twitter} alt='twitter' className='socialsIcon'/>
		</a>

		<a href='https://www.twitch.tv/tarayah'  target='_blank' className='socialsIcon'>
		<img src={Twitch} alt='twitch' className='socialsIcon'/>
		</a>

		<a href='https://www.discord.com'  target='_blank' className='socialsIcon'>
		<img src={Discord} alt='discord' className='socialsIcon'/>
		</a>

		</div>
	)

	return (

		<div>
		<div>
		{socialsIcon}
		{logo}
		</div>
       </div>

	);

};
export default Header;
